import React, { useEffect, useState } from 'react';
import { getHistory } from '../services/api';
import HistoryItem from '../components/HistoryItem';

const History = () => {
  const [history, setHistory] = useState({ meals: [], workouts: [] });

  useEffect(() => {
    const fetchHistory = async () => {
      const res = await getHistory(1);
      setHistory(res.data);
    };
    fetchHistory();
  }, []);

  return (
    <div className="p-4">
      <h2 className="text-2xl font-bold">Lịch sử của bạn</h2>

      <div className="mt-4">
        <h3 className="text-xl font-semibold">Meals</h3>
        {history.meals.map((item, idx) => <HistoryItem key={idx} item={item} type="meal" />)}
      </div>

      <div className="mt-4">
        <h3 className="text-xl font-semibold">Workouts</h3>
        {history.workouts.map((item, idx) => <HistoryItem key={idx} item={item} type="workout" />)}
      </div>
    </div>
  );
};

export default History;
